import classes from "../../ui/UI.module.css";
import siteData from "../../../context/siteData";
const Library = () => {
  const getAlbum = function (siteData) {
    for (let i = 0; i < siteData[0].length; i++) {
       const albumTitle = siteData[0].albumName;

     return <li><h3>{albumTitle}</h3></li>
    }


  };

  const album = siteData[1].album.tracks.map((track) =>
    console.log(track.trackName)
  );
  return (
    <div className={classes.section_view}>
      <ul>{getAlbum(siteData)}</ul>
    </div>
  );
};

export default Library;
